IF OBJECT_ID('dbo.proc_transform_261', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_261;
GO
CREATE PROCEDURE dbo.proc_transform_261
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_261
    SET payload = LEFT(payload, 1000) + N'|V4-261|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_261;
END
GO
IF OBJECT_ID('dbo.audit_v4_261', 'U') IS NULL
BEGIN
    CREATE TABLE dbo.audit_v4_261 (aid INT IDENTITY(1,1) PRIMARY KEY, msg NVARCHAR(2000), created_on DATETIME2 DEFAULT SYSUTCDATETIME());
END
GO
EXEC dbo.proc_transform_261;
